import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./Header.scss";
// import Upload from "../Upload/Upload";
export default class Header extends React.Component {
  handleUpload = e => {
    <Link className="header__upload--text" to="/upload"></Link>;
  };
  render() {
    return (
      <header className="header">
        <Router>
          <div className="header__logo">
            <Link to="/"></Link>
          </div>

          <div className="header__interact">
            <div className="header__search--wrapper">
              <input
                placeholder="Search"
                type="text"
                name="search"
                id=""
                className="header__search"
              />
              <div className="header__search--icon"></div>
            </div>
            <div className="header__actions">
              <button onClick={this.handleUpload} className="header__upload">
                <div className="header__upload--icon">
                  <span className="header__upload--text">
                    UPLOAD
                    {/* <span className="header__upload--text">UPLOAD</span> */}
                  </span>
                </div>
              </button>
              <div className="header__user"></div>
            </div>
          </div>
        </Router>
      </header>
    );
  }
}
